import { Container, Row, Col, BreadcrumbItem, Breadcrumb } from "shards-react";
import { Tab, Tabs, TabContent } from "react-bootstrap";
import uuidv4 from "uuid";
import Head from "next/head";

// Layout
import Layout from "../../components/Layout";
import SEO from "react-seo-component";

const MeetAna = props => (
  <Layout>
    <Head>
      <title>Directed Situations | CXC Spanish Guide</title>
      <meta name="og:title" content="" />
      <meta name="og:site_name" content="CXC Spanish Online" />
      <meta
        name="description"
        content="Learn how to respond to Directed Situations, second 1 on your CXC Spanish exam"
      />

      <SEO
        title={"Meet Ana - Listening Exercise | CXC Spanish Guide"}
        description={
          "Practice your Spanish listening skills with Ana. Pass your CXC Spanish exam with our free online study guide."
        }
        twitterUsername={"_rxhem"}
        author={"Raheem McDonald"}
        article={true}
        publishedDate={Date.now()}
        modifiedDate={Date.now()}
      />
    </Head>
    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <a href="/exam-topics">Listening Exercises</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Meet Ana</BreadcrumbItem>
      </Breadcrumb>
    </Container>
  </Layout>
);

export default MeetAna;
